Im Rahmen des Internet Governance Forums #IGF2019, das vergangene Woche in Berlin stattfand, haben auch Digitalexperten der Unionsfraktion gesprochen. Hier die Rede von 
@Hansjoerg_Durz
  https://youtu.be/8fCUw55zt8s?t=1247… und von 
@RonjaKemmer
   https://youtu.be/8fCUw55zt8s?t=3703…

Die Versammlung der Parlamentarier aus aller Welt auf dem #IGF2019 habe ich heute im Namen von 
@jimmyschulz
 eröffnet. Seinen Kampf für die digitale Aufklärung werden wir weiterführen! Vor seiner Lebensleistung verneige ich mich. Meine Gedanken sind bei seiner Familie.

